fetch spans, from: -30m, to: now(), scanLimitGBytes: 500

// filter for http client spans
| filter span.kind == "client" and isNotNull(http.request.method)

// lookup service entity and use the service entity name as span attribute
| lookup [fetch dt.entity.service], sourceField: dt.entity.service, lookupField: id, fields: { service.name = entity.name }

| summarize { http_spans=count() }, by: { service.name, http.request.method, url.full }

// top 100
| sort http_spans desc | limit 100 | fieldsRemove url.full

